import React from 'react'
import { string } from 'prop-types'
import SearchBar from '../search-bar'

const Hero = ({ headline }) => (
  <section className="ui vertical center aligned segment wwc-hero">
    <div className="ui text container">
      <h1 className="ui header">{headline}</h1>
      <SearchBar />
    </div>
  </section>
)

Hero.propTypes = {
  headline: string
}

Hero.defaultProps = {
  headline: 'Experimente as melhores cafeteiras para trabalhar'
}

export default Hero
